import './Experience.css';
import Page from "../../components/Page/Page.js";
import Card from "../../components/Card/Card.js";

import EY_logo from "../../images/EY-logo.png";
import Lehigh_logo from "../../images/Lehigh-logo.png";

function Experience(props) {
  return (
    <Page id="Experience" header="Experience">
      <Card 
        image={EY_logo}
        alt='EY logo'
        title='Technology Consulting Intern, Ernst and Young'
        subtitle='June 2021 - August 2021'
        description="My name is Ryan Schmid, a computer science Master's student at Lehigh Univeristy. 
        Before my time as a graduate student, I completed two Bachelor's degrees at Lehigh, 
        one in Computer Engineering and the other in Inegrated Business and Engineering (IBE) with a major in Finance 
        as part of the university's IBE Honors Program."
      />
      <Card 
        image={Lehigh_logo}
        alt='Lehigh logo'
        title='Academic Tutor, Lehigh University'
        subtitle='February 2021 - May 2021'
        description="My name is Ryan Schmid, a computer science Master's student at Lehigh Univeristy. 
        Before my time as a graduate student, I completed two Bachelor's degrees at Lehigh, 
        one in Computer Engineering and the other in Inegrated Business and Engineering (IBE) with a major in Finance 
        as part of the university's IBE Honors Program. My name is Ryan Schmid, a computer science Master's student at Lehigh Univeristy. 
        Before my time as a graduate student, I completed two Bachelor's degrees at Lehigh, 
        one in Computer Engineering and the other in Inegrated Business and Engineering (IBE) with a major in Finance 
        as part of the university's IBE Honors Program."
      />
    </Page>
  );
}

export default Experience;
